import messageReducer from "./features/auth/messageSlice";

const reducer = {
  auth: authReducer,
  message: messageReducer
}
export const store = configureStore({
    reducer : reducer,
    devTools: true,
    middleware : (getDefaultMiddleware) => getDefaultMiddleware({
